          this._chartBodyG = this._g.append('g').attr('class', 'chart-body')
              .attr('transform', `translate(${this.margins().left}, ${this.margins().top})`)
              .attr('clip-path', `url(${href}#${this._getClipPathId()})`);

          return this._g;
